import React from 'react'

const App = () => {
  const currentDate= new Date().toLocaleDateString();
  let time=currentDate.getTime()
  return (
    <div>
      <h1>hello</h1>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
        <li>4</li>
        <li>5</li>
      </ul>
      <h1>{currentDate}</h1>
      <h1>{time}</h1>
    </div>
  )
}

export default App
